import React from 'react';
import { useNavigate } from 'react-router-dom';

const Dashboard = () => {
  const navigate = useNavigate();

  const handleLogout = () => {
    localStorage.removeItem('token');
    navigate('/');
  };

  return (
    <div style={{ padding: '20px' }}>
      <div style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', marginBottom: '20px' }}>
        <h1>Dashboard</h1>
        <button onClick={handleLogout} style={{ padding: '8px 15px', backgroundColor: '#dc3545', color: 'white', border: 'none' }}>
          Logout
        </button>
      </div>
      
      <div style={{ display: 'grid', gridTemplateColumns: 'repeat(auto-fit, minmax(250px, 1fr))', gap: '20px' }}>
        <div 
          style={{ padding: '20px', border: '1px solid #ddd', borderRadius: '5px', cursor: 'pointer', textAlign: 'center' }}
          onClick={() => navigate('/agents')}
        >
          <h3>Manage Agents</h3>
          <p>Create and view agents</p>
        </div>
        
        <div 
          style={{ padding: '20px', border: '1px solid #ddd', borderRadius: '5px', cursor: 'pointer', textAlign: 'center' }}
          onClick={() => navigate('/upload')}
        >
          <h3>Upload Lists</h3>
          <p>Upload and distribute CSV files</p>
        </div>
        
        <div 
          style={{ padding: '20px', border: '1px solid #ddd', borderRadius: '5px', cursor: 'pointer', textAlign: 'center' }}
          onClick={() => navigate('/distributed')}
        >
          <h3>View Distributed Lists</h3>
          <p>Check distributed items to agents</p>
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
